import React from 'react';
import { Box, Typography, Container, Stack, Link as MuiLink, Divider, Grid, IconButton } from '@mui/material';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import XIcon from '@mui/icons-material/X';
import LanguageIcon from '@mui/icons-material/Language';

const navLinks = [
  { label: 'Features', href: '/features' },
  { label: 'Pricing', href: '/pricing' },
  { label: 'About', href: '/about' },
  { label: 'Contact', href: '/contact' },
];

const Footer = () => (
  <Box component="footer" sx={{
    py: { xs: 5, md: 6 },
    bgcolor: '#181c32',
    color: '#fff',
    mt: 8,
    borderTop: '2px solid #1976d2',
    boxShadow: '0 -2px 24px 0 #181c32',
    fontFamily: 'serif',
  }}>
    <Container maxWidth="lg">
      <Stack
        direction={{ xs: 'column', md: 'row' }}
        spacing={{ xs: 4, md: 0 }}
        justifyContent="space-between"
        alignItems={{ xs: 'flex-start', md: 'center' }}
        sx={{ mb: 3 }}
      >
        {/* Logo & tagline */}
        <Stack direction="row" spacing={2} alignItems="center" sx={{ mb: { xs: 2, md: 0 } }}>
          <img src="/gogetwell-logo-white.png" alt="GoGetWell AI Logo" style={{ height: 36, width: 'auto', background: 'transparent', filter: 'drop-shadow(0 2px 8px #1976d2)' }} />
          <Typography variant="h6" fontWeight="bold" sx={{ color: '#fff', letterSpacing: 1 }}>
            GoGetWell AI
          </Typography>
        </Stack>
        {/* Navigation */}
        <Stack direction="row" spacing={3} flexWrap="wrap" justifyContent="center" alignItems="center">
          {navLinks.map(link => (
            <MuiLink
              key={link.label}
              href={link.href}
              underline="hover"
              color="#bbdefb"
              sx={{ fontWeight: 'bold', letterSpacing: 1, fontSize: 16, mx: 1, my: { xs: 1, md: 0 } }}
            >
              {link.label}
            </MuiLink>
          ))}
        </Stack>
        {/* Socials */}
        <Stack direction="row" spacing={2} alignItems="center" justifyContent="center">
          <IconButton href="https://www.linkedin.com/" target="_blank" rel="noopener" sx={{ bgcolor: '#fff', color: '#1976d2', '&:hover': { bgcolor: '#ede7f6' }, p: 1 }}>
            <LinkedInIcon fontSize="medium" />
          </IconButton>
          <IconButton href="https://x.com/" target="_blank" rel="noopener" sx={{ bgcolor: '#fff', color: '#111', '&:hover': { bgcolor: '#e3f2fd' }, p: 1 }}>
            <XIcon fontSize="medium" />
          </IconButton>
          <IconButton href="https://gogetwell.ai" target="_blank" rel="noopener" sx={{ bgcolor: '#fff', color: '#1976d2', '&:hover': { bgcolor: '#ede7f6' }, p: 1 }}>
            <LanguageIcon fontSize="medium" />
          </IconButton>
        </Stack>
      </Stack>
      <Divider sx={{ bgcolor: '#1976d2', my: 2 }} />
      <Typography variant="body2" align="center" color="#bbdefb" sx={{ letterSpacing: 1, fontWeight: 400 }}>
        {new Date().getFullYear()} GoGetWell AI. All rights reserved. | Designed with <span style={{ color: '#e57373' }}>â™¥</span> for medical tourism
      </Typography>
    </Container>
  </Box>
);

export default Footer;
